type DataResponse =
  | {
      message?: string
      code?: number
    }
  | any

class BuildResponse {
  private static baseResponse(dataResponse: DataResponse) {
    const {
      message = 'Data sudah diterima',
      code = 200,
      ...rest
    } = dataResponse
