      })
      .matches(/[A-Z]+/, {
        message: "Password harus mengandung huruf besar",
      }),
    confirmNewPassword: yup.string().when("newPassword", {
      is: (newPassword: string) => !!newPassword,
      then: (schema: any) =>
        schema
